import React,{useEffect} from "react";
import { observer, inject } from "mobx-react";

const TasksList = inject("tasksManager")(
  observer((props) => {
    useEffect(() => {
      (async () => {
        await props.tasksManager.getTasks();
      })();
    }, []);
    
     console.log(props.tasksManager.tasks[0].name)
    return <>
    <div>{props.tasksManager.tasks[0].name}</div></>;
  })
);
export default TasksList;
